import { Grid, Typography } from "@mui/material";

const Expiriances = () => {
  return (
    <Grid container alignItems="baseline">
      <div>Expiriances</div>
      <Grid item xs={3}>
            <Typography variant="subtitle1">Languages & Frameworks:</Typography>
          </Grid>
    </Grid>
  );
};

export default Expiriances;
